import {Post} from './States'
export enum actions {
    GETALLPOSTS = 'GETALLPOSTS',
    GETONEPOST = 'GETONEPOST',
    GETCOMMENTS = 'GETCOMMENTS',
    POST = 'POST',
    DELETE = 'DELETE'
}

export interface GetAllPostsAction {
    type: typeof actions.GETALLPOSTS
}

export interface GetOnePostAction {
    type: typeof actions.GETONEPOST,
    id: number
}

export interface GetComments {
    type: typeof actions.GETCOMMENTS,
    id: number
}

export interface PostData {
    type: typeof actions.POST,
    data : Post
}
export interface DeletePost {
    type: typeof actions.DELETE,
    id: number
}
export type PostActionTypes = 
    GetAllPostsAction 
    | GetOnePostAction
    | GetComments
    | PostData
    | DeletePost;
